digan to\'lovlarning umumiy narxi.','Total tax on items in the cart.'=>'Savatdagi narsalar uchun umumiy soliq.','Total price of items in the cart.'=>'Savatdagi narsalarning umumiy narxi.','Cart total amounts provided using the smallest unit of the currency.'=>'Savatdagi jami summalar valyutaning eng kichik birligidan foydalangan holda taqdim etiladi.','True if the cart needs payment. False for carts with only free products and no shipping costs.'=>'Agar aravaga to\'lov kerak bo\'lsa, to\'g\'ri. Faqat bepul mahsulotlar va yuk tashish xarajatlari bo\'lmagan aravalar uchun noto\'g\'ri.','Current set shipping address for the customer.'=>'Mijoz uchun joriy yuk tashish manzili.','List of available shipping rates for the cart.'=>'Savat uchun mavjud yuk stavkalari ro\'yxati.','List of applied cart coupons.'=>'Qo\'llaniladigan arava kuponlari ro\'yxati.','Error message'=>'Xato xabar','Error code'=>'Xato kodi','Number of reviews for products in this category.'=>'Ushbu turkumdagi mahsulotlar uchun sharhlar soni.','Category image.'=>'Kategoriyadagi rasm.','Returns number of products within attribute terms.'=>'Atribut shartlaridagi mahsulotlar sonini qaytaradi.','Min and max prices found in collection of products, provided using the smallest unit of the currency.'=>'Pul birligining eng kichik birligidan foydalangan holda taqdim etilgan mahsulotlar kolleksiyasida topilgan minimal va maksimal narxlar.','%1$s requires an instance of %2$s or %3$s for the address'=>'%1$s manzil uchun %2$s yoki %3$s misolini talab qiladi','Country/Region code in ISO 3166-1 alpha-2 format.'=>'ISO 3166-1 alfa-2 formatidagi davlat/mintaqa kodi.','State/County code, or name of the state, county, province, or district.'=>'Shtat/tuman kodi yoki shtat, tuman, viloyat yoki tuman nomi.','Apartment, suite, etc.'=>'Kvartira, suite va boshqalar.','Price prefix for the currency which can be used to format returned prices.'=>'Qaytarilgan narxlarni formatlash uchun ishlatilishi mumkin bo\'lgan valyuta uchun narx prefiksi.','Thousand separator for the currency which can be used to format returned prices.'=>'Qaytarilgan narxlarni formatlash uchun ishlatilishi mumkin bo\'lgan valyuta uchun ming ajratuvchi.','Decimal separator for the currency which can be used to format returned prices.'=>'Qaytarilgan narxlarni formatlash uchun ishlatilishi mumkin bo\'lgan valyuta uchun o\'nlik ajratgich.','Currency minor unit (number of digits after the decimal separator) for returned prices.'=>'Qaytarilgan narxlar uchun kichik valyuta birligi (o\'nlik ajratgichdan keyingi raqamlar soni).','Currency symbol for the currency which can be used to format returned prices.'=>'Qaytarilgan narxlarni formatlash uchun ishlatilishi mumkin bo\'lgan valyuta uchun valyuta belgisi.','Currency code (in ISO format) for returned prices.'=>'Qaytarilgan narxlar uchun valyuta kodi (ISO formatida).','Total tax removed due to discount applied by this coupon.'=>'Ushbu kupon qoʻllanilgan chegirma tufayli jami soliq olib tashlandi.','Total discount applied by this coupon.'=>'Ushbu kupon tomonidan qo\'llaniladigan umumiy chegirma.','Total amounts provided using the smallest unit of the currency.'=>'Pul birligining eng kichik birligidan foydalangan holda taqdim etilgan umumiy summalar.','The coupons unique code.'=>'Kuponlarning noyob kodi.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'To\'lovdan keyin mijozni qayta yo\'naltirish uchun URL. Bu, masalan, to\'lov protsessorlari veb-saytiga havola bo\'lishi mumkin.','An array of data being returned from the payment gateway.'=>'Toʻlov shlyuzidan qaytarilayotgan maʼlumotlar majmuasi.','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Shlyuz tomonidan qaytarilgan to\'lovning holati. Muvaffaqiyatdan biri, kutilayotgan, muvaffaqiyatsizlik, xato.','Result of payment processing, or false if not yet processed.'=>'To\'lovni qayta ishlash natijasi yoki hali qayta ishlanm