nnot be used in conjunction with other coupons.'=>'“%s” allaqachon qo‘llanilgan va uni boshqa kuponlar bilan birgalikda ishlatib bo‘lmaydi.','Coupon code "%s" has already been applied.'=>'“%s” kupon kodi allaqachon qo‘llanilgan.','"%s" is an invalid coupon code.'=>'“%s” yaroqsiz kupon kodi.','Cart item is invalid.'=>'Savatdagi mahsulot yaroqsiz.','Invalid coupons were removed from the cart: "%s"'=>'Savatdan yaroqsiz kuponlar olib tashlandi: "%s"','Cannot create order from empty cart.'=>'Boʻsh savatdan buyurtma yaratib boʻlmaydi.','The chosen rate ID for the package.'=>'Paket uchun tanlangan tarif identifikatori.','Limit result set to reviews from specific product IDs.'=>'Natijalar toʻplamini muayyan mahsulot identifikatorlaridagi sharhlar bilan cheklang.','Limit result set to reviews from specific category IDs.'=>'Natijalar toʻplamini muayyan toifa identifikatorlaridagi sharhlar bilan cheklang.','Method not implemented'=>'Usul amalga oshirilmagan','New quantity of the item in the cart.'=>'Savatdagi buyumning yangi miqdori.','Unique identifier (key) for the cart item to update.'=>'Yangilash uchun savat elementi uchun noyob identifikator (kalit).','The %s payment gateway is not available.'=>'%s toʻlov shlyuzi mavjud emas.','No payment method provided.'=>'Toʻlov usuli koʻrsatilmagan.','Invalid payment result received from payment method.'=>'Toʻlov usulidan olingan toʻlov natijasi notoʻgʻri.','Data to pass through to the payment method when processing payment.'=>'Toʻlovni qayta ishlashda toʻlov usuliga oʻtish uchun maʼlumotlar.','Cart item no longer exists or is invalid.'=>'Savatdagi mahsulot endi mavjud emas yoki yaroqsiz.','Unique identifier (key) for the cart item.'=>'Savat elementi uchun noyob identifikator (kalit).','If true, empty terms will not be returned.'=>'Agar rost bo\'lsa, bo\'sh shartlar qaytarilmaydi.','Sort by term property.'=>'Termin xususiyati bo\'yicha saralash.','Sort ascending or descending.'=>'O\'sish yoki pasayish bo\'yicha tartiblang.','Coupon does not exist in the cart.'=>'Kupon savatda mavjud emas.','Coupon cannot be removed because it is not already applied to the cart.'=>'Kuponni olib tashlab bo\'lmaydi, chunki u allaqachon savatga qo\'llanilmagan.','Invalid coupon code.'=>'Kupon kodi yaroqsiz.','Coupons are disabled.'=>'Kuponlar o\'chirilgan.','Unique identifier for the coupon within the cart.'=>'Savatdagi kupon uchun noyob identifikator.','ISO code for the country of the address being shipped to.'=>'Yuborilayotgan manzil mamlakatining ISO kodi.','Zip or Postcode of the address being shipped to.'=>'Yuborilayotgan manzilning pochta indeksi yoki pochta indeksi.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'ISO kodi yoki yuborilayotgan manzilning shtat, viloyat yoki tuman nomi.','City of the address being shipped to.'=>'Yuborilayotgan manzil shahri.','Second line of the address being shipped to.'=>'Yuborilayotgan manzilning ikkinchi qatori.','First line of the address being shipped to.'=>'Yuborilayotgan manzilning birinchi qatori.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Eng kichik valyuta birligidan foydalangan holda taqdim etilgan maksimal narxga asoslangan mahsulotlar uchun natijalar to\'plamini cheklang.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Eng kichik valyuta birligidan foydalangan holda taqdim etilgan minimal narxga asoslangan mahsulotlar uchun natijalar to\'plamini cheklang.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Natijalar to\'plamida qaytariladigan elementlarning maksimal soni. Agar bo\'sh qoldirilgan bo\'lsa, birlamchi cheklovsiz.','Invalid category ID.'=>'Kategoriya identifikatori noto‘g‘ri.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'WooCommerce %1$s jadvali yaratilmadi. %2$s foydalanuvchisi %3$s maʼlumotlar bazasida CREATE imtiyozlariga egami?','Verifying database... One or more tables are still missing: '=>'Maʼlumotlar bazasi tekshirilmoqda... Bir yoki bir nechta jadval hali ham yoʻq: ','Database verified successfully.'=>'Maʼlumotlar bazasi muvaffaqiyatli tasdiqlandi.','You need WooCommerce 4.2 or newer to run this tool.'=>'Ushbu vositani ishga tushirish uchun sizga WooCommerce 4.2 yoki undan yangiroq versiyasi kerak.','The active version of WooCommerce does not support template cache clearing.'=>'WooCommerce-ning faol versiyasi shablon keshini tozalashni qo\'llab-quvvatlamaydi.','Template cache cleared.'=>'Shablon keshi tozalandi.','Verify if all base database tables are present.'=>'Barcha asosiy ma\'lumotlar bazasi jadvallari mavjudligini tekshiring.','Verify database'=>'Ma\'lumotlar bazasini tekshiring','Verify base database tables'=>'Asosiy ma\'lumotlar bazasi jadvallarini tekshiring','This tool will empty the template cache.'=>'Ushbu vosita shablon keshini bo\'shatadi.','Clear template cache'=>'Shablon keshini tozalash','Collect and validate EU VAT numbers at checkout'=>'Hisob-kitob paytida YI QQS raqamlarini to\'plang va tasdiqlang','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Agar doʻkoningiz Yevropa Ittifoqida joylashgan boʻlsa, avtomatlashtirilgan soliqlarga qoʻshimcha ravishda YI QQS raqami kengaytmasidan foydalanishni tavsiya etamiz. Bu mijozning EI QQS raqamini to\'plash va tasdiqlash uchun, agar ularda bor bo\'lsa, to\'lovni amalga oshiradi.','Get real-time order alerts anywhere'=>'Istalgan joyda real vaqt rejimida buyurtma haqida ogohlantirishlarni oling','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Woo ilovasi yordamida doʻkon faoliyati, jumladan, yangi buyurtmalar va mahsulot sharhlari haqidagi bildirishnomalarni bevosita mobil qurilmalaringizda oling.','First order received'=>'Birinchi buyurtma qabul qilindi','Remove legacy coupon menu'=>'Eski kupon menyusini olib tashlang','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Kuponlarni endi Marketing > Kuponlar orqali boshqarish mumkin. Eski WooCommerce > Kuponlar menyusini olib tashlash uchun quyidagi tugmani bosing.','Coupon management has moved!'=>'Kupon boshqaruvi ko\'chirildi!','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ushbu video darslik sizga WooCommerce-da birinchi mahsulotingizni qo\'shish jarayonidan o\'tishga yordam beradi.','Do you need help with adding your first product?'=>'Birinchi mahsulotingizni qo\'shishda yordam kerakmi?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Moda veb-saytini ochish juda hayajonli, ammo bu juda qiyin bo\'lib tuyulishi mumkin. Ushbu maqolada biz sizni sozlash jarayoni bo\'ylab ko\'rsatamiz, muvaffaqiyatli mahsulot ro\'yxatini yaratishni o\'rgatamiz va ideal auditoriyangizni qanday sotishni ko\'rsatamiz.','Start your online clothing store'=>'Onlayn kiyim do\'koningizni boshlang','The admin note layout has a wrong prop value.'=>'Administrator yozuvi tartibi noto‘g‘ri rekvizit qiymatiga ega.','Watch tutorial'=>'Qo\'llanmani tomosha qiling','Share feedback'=>'Fikr almashish','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Endi siz bizni hamkor sifatida tanladingiz, bizning maqsadimiz sizning ehtiyojlaringizni qondirish uchun to‘g‘ri vositalarni taqdim etayotganimizga ishonch hosil qilishdir. Kelajakda uni yaxshilashimiz uchun doʻkonni sozlash tajribasi haqida fikr-mulohazalaringizni kutib qolamiz.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Elektron tijorat platformalarini o\'zgartirish engib o\'tish uchun katta to\'siq bo\'lib tuyulishi mumkin, ammo mahsulotlaringiz, mijozlaringiz va buyurtmalaringizni WooCommerce-ga o\'tkazish siz o\'ylaganingizdan osonroqdir. Ushbu maqola ushbu jarayondan o\'tishga yordam beradi.','Do you want to migrate from Shopify to WooCommerce?'=>'Shopify\'dan WooCommerce\'ga o\'tishni xohlaysizmi?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce obunalari jismoniy yoki virtual mahsulot va xizmatlar uchun turli obunalarni joriy qilish imkonini beradi. Oylik mahsulot klublari, haftalik xizmat obunalari yoki hattoki yillik dasturiy ta\'minot to\'plamlarini yarating. Roʻyxatdan oʻtish toʻlovlarini qoʻshing, bepul sinovlarni taklif qiling yoki amal qilish muddatini belgilang.','Not enough units of %s are available in stock to fulfil this order.'=>'Ushbu buyurtmani bajarish uchun stokda %s birlik mavjud emas.','&quot;%s&quot; is out of stock and cannot be purchased.'=>'& quot; %s & quot; mavjud emas va sotib olinmaydi.','Do you need more info about WooCommerce Subscriptions?'=>'Sizga WooCommerce obunalari haqida ko\'proq ma\'lumot kerakmi?','There was a problem activating some of the requested plugins.'=>'Baʼzi soʻralgan plaginlarni faollashtirishda muammo yuz berdi.','Plugins were successfully activated.'=>'Plaginlar