s with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Kredit va debet kartalarini bitta past stavka bilan, hech qanday ajablantiradigan to\'lovsiz xavfsiz qabul qiling (maxsus narxlar mavjud). Internetda va do\'konlarda soting va sotuvlar va inventarlarni bir joyda kuzatib boring.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.'=>'O\'zingiz xohlagan to\'lovni tanlang, hozir to\'lang, keyinroq to\'lang. Kredit karta raqamlari yo\'q, parollar yo\'q, tashvishlar yo\'q.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.'=>'135+ valyutadagi debet va kredit kartalarini, Alipay kabi usullarni va Apple Pay yordamida bir martalik to\'lovni qabul qiling.','Purchase & install now'=>'Hozir sotib oling va o\'rnating','Average order value'=>'O\'rtacha buyurtma qiymati','Gross sales'=>'Gross Sales','Customer type'=>'Mijoz turi','Edit Product'=>'Mahsulotni tahrirlash','Edit Coupon'=>'Kuponni tahrirlash','Edit Order'=>'Buyurtmani tahrirlash','Download your %s Report'=>'%s hisobotingizni yuklab oling','Current page retrieval should be called on or after the `current_screen` hook.'=>'Joriy sahifani qidirishni "current_screen" kancasidan keyin yoki keyin chaqirish kerak.','Task List'=>'Vazifalar ro\'yxati','Disable'=>'O\'chirish','Profile Setup Wizard'=>'Profilni o\'rnatish ustasi','WooCommerce Onboarding'=>'WooCommerce Onboarding','Home, furniture, and garden'=>'Uy, mebel va bog\'','Food and drink'=>'Ovqat va ichimlik','Electronics and computers'=>'Elektronika va kompyuterlar','Health and beauty'=>'Salomatlik va go\'zallik','Fashion, apparel, and accessories'=>'Moda, kiyim va aksessuarlar','Analytics'=>'Tahlil','[deleted]'=>'[o\'chirildi]','IP address.'=>'P manzili.','A partial IP address can be passed and matching results will be returned.'=>'Qisman IP-manzilni uzatish mu