idan-to\'g\'ri bank / o\'tkazma sifatida tanilgan.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'Ushbu bo\'limda siz do\'konda to\'lovlarni amalga oshirishda foydalanadigan uchinchi tomon to\'lov protsessorlarini ro\'yxatlashingiz kerak, chunki ular mijozlar ma\'lumotlarini boshqarishi mumkin. Biz PayPal-ni misol sifatida qo\'shdik, ammo agar siz PayPal-dan foydalanayotgan bo\'lsangiz, uni olib tashlashingiz kerak.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Biz buyurtmalarni taqdim etishda va sizga xizmatlarni saqlashda yordam beradigan uchinchi tomonlar bilan ma\'lumot almashamiz; masalan --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'Ushbu bo\'limda siz kim bilan va nima maqsadda ma\'lumot almashayotganingizni ko\'rsatishingiz kerak. Bunga tahlil, marketing, to\'lov shlyuzlari, etkazib beruvchilar va begona tashkilotlar kirishi mumkin, ammo ular bilan cheklanmasligi mumkin.','What we share with others'=>'Biz boshqalar bilan baham ko\'ramiz','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Jamoamiz a\'zolari buyurtmalarni bajarish, to\'lovlarni qaytarish va sizni qo\'llab-quvvatlash uchun ushbu ma\'lumotlarga kirish huquqiga ega.','Customer information like your name, email address, and billing and shipping information.'=>'Sizning ismingiz, elektron pochta manzilingiz, to\'lov va etkazib berish ma\'lumotlari kabi xaridor haqidagi ma\'lumotlar.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Qanday sotib 