s like estimating taxes and shipping'=>'Joylashuvi, IP manzili va brauzer turi: biz undan soliq va yukni hisoblash kabi maqsadlarda foydalanamiz','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Siz koʻrgan mahsulotlar: biz bundan, masalan, yaqinda koʻrgan mahsulotlaringizni koʻrsatish uchun foydalanamiz','While you visit our site, we’ll track:'=>'Siz bizning saytimizga tashrif buyurganingizda, biz quyidagilarni kuzatamiz:','What we collect and store'=>'Biz nimani yig\'amiz va saqlaymiz','We collect information about you during the checkout process on our store.'=>'Do\'konda to\'lovlarni amalga oshirish paytida siz haqingizda ma\'lumot yig\'amiz.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ushbu namunaviy til do\'koningiz shaxsiy ma\'lumotlarini to\'plash, saqlash va almashish, shuningdek ushbu ma\'lumotlarga kirish huquqiga ega bo\'lganlarning asoslarini o\'z ichiga oladi. Qanday sozlamalar yoqilganligi va qaysi qo\'shimcha plaginlardan foydalanilganiga qarab, sizning do\'koningiz tomonidan ulashilgan aniq ma\'lumotlar har xil bo\'lishi mumkin. Maxfiylik siyosatingizda qanday ma\'lumotlarni oshkor qilish to\'g\'risida qaror qabul qilganda advokat bilan maslahatlashishni maslahat beramiz.','Token'=>'Token','Payment Tokens'=>'To\'lov tokenlari','Access granted'=>'Kirish huquqi berilgan','Download count'=>'Yuklanishlar soni','User email'=>'Foydalanuvchi email','Browser User Agent'=>'Brauzer foydalanuvchi agenti','Order Number'=>'Buyurtma raqami','Items Purchased'=>'Sotib olingan narsalar','optional'=>'ixtiyoriy','Display name'=>'Ismingizning boshqalarga ko‘rin