m your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'%1$s o\'zgartirilganligi sababli savatingizdan olib tashlandi. Siz uni <a href="%2$s">bu yerga</a> yana o\'zingizning savatingizga qo\'shishingiz mumkin.','Removed payment token "%d"'=>'"%d" to\'lov belgisi olib tashlandi','Deleted all active sessions, and %d saved carts.'=>'Barcha faol seanslar va %d saqlangan savatchalar tozalandi.','%d permissions deleted'=>'%d ruxsatlar o\'chirildi','WooCommerce pages'=>'WooCommerce sahifalari','WooCommerce database version'=>'WooCommerce ma\'lumotlar bazasining versiyasi','Displays whether or not WordPress is using an external object cache.'=>'WordPress tashqi ob\'ekt keshidan foydalanadimi yoki yo\'qligini ko\'rsatadi.','External object cache'=>'Tashqi ob\'ekt keshi','WordPress cron'=>'WordPress cron','WordPress debug mode'=>'WordPress nosozliklarni tuzatish rejimi','WordPress memory limit'=>'WordPress xotira chegarasi','WordPress multisite'=>'WordPress multisite','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - WordPress-ning yangi versiyasi mavjud (%2$s)','WordPress version'=>'WordPress versiyasi','WooCommerce version'=>'WooCommerce versiyasi','Settings tab labelPayments'=>'To\'lovlar','Enable coupons'=>'Kuponlarni yoqing','Rates will be configurable and taxes will be calculated during checkout.'=>'Stavkalar sozlanishi va soliqni hisoblash paytida hisoblab chiqiladi.','Enable tax rates and calculations'=>'Soliq stavkalari va hisob-kitoblarni yoqing','Manage'=>'Boshqarish','Enable the legacy REST API'=>'Eski REST API-ni yoqish','Account endpoints'=>'Hisobning so\'nggi nuqtalari','Secure checkout'=>'Xavfsiz chiqish','Legacy API'=>'Legacy API','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Shaxsiy ma\'lumotlaringizni anonimlashtirishdan oldin, tugallangan buyurtmalarni belgilangan muddat davomida saqlang.','Retain completed orders'=>'Bajarilgan buyurtmalarni saqlang','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Bekor qilingan buyurtmalar to\'lanmaydi va do\'kon egasi yoki mijoz tomonidan bekor qilingan bo\'lishi mumkin. Belgilangan vaqtdan keyin ular axlatga tashlanadi.','Retain cancelled orders'=>'Bekor qilingan buyurtmalarni saqlab qo\'ying','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Bajarilmagan buyurtmalar to\'lanmagan va mijoz tomonidan qoldirilgan bo\'lishi mumkin. Belgilangan vaqtdan keyin ular axlatga tashlanadi.','Retain failed orders'=>'Muvaffaqiyatsiz buyurtmalarni saqlang','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Kutilayotgan buyurtmalar to\'lanmagan va mijoz tomonidan qoldirilgan bo\'lishi mumkin. Belgilangan vaqtdan keyin ular axlatga tashlanadi.','Retain pending orders '=>'Kutilayotgan buyurtmalarni saqlang ','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Faol bo\'lmagan hisoblar - bu ko\'rsatilgan vaqt davomida tizimga kirmagan yoki buyurtma berganlar. Ular o\'chiriladi. Har qanday buyurtmalar mehmon buyurtmalariga aylantiriladi.','Retain inactive accounts '=>'Faol bo\'lmagan hisoblarni saqlang ','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Shaxsiy ma\'lumotlarni qayta ishlash uchun zarur bo\'lmaganda, uni qancha saqlash kerakligini tanlang. Ushbu ma\'lumotni noma\'lum saqlash uchun quyidagi parametrlarni bo\'sh qoldiring.','Personal data retention'=>'Shaxsiy ma\'lumotlarni saqlash','Your personal data will be used to process your order, support your experience throughout this website, and f