dress line for your business location.'=>'Sizning ish joyingiz uchun qo\'shimcha, ixtiyoriy manzillar qatori.','The street address for your business location.'=>'Ish joyingiz uchun ko\'cha manzili.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Bu sizning biznesingiz joylashgan joy. Soliq stavkalari va etkazib berish stavkalari ushbu manzildan foydalanadi.','Store Address'=>'Do\'kon manzili','Update now'=>'Yangilash','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Quyidagi faol plagin (lar) WooCommerce %s bilan mosligini hali e\'lon qilmagan va davom ettirishdan oldin yangilanishi va ko\'rib chiqilishi kerak:','Tested up to WooCommerce version'=>'WooCommerce versiyasiga qadar sinovdan o\'tgan','Plugin'=>'Plagin','unknown'=>'noma\'lum','<strong>Heads up!</strong> The versions of the following plugins you\'re running haven\'t been tested with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong>Ruhni tushirmang!</strong> Quyidagi plaginlarning versiyalari WooCommerce %s bilan sinovdan o\'tkazilmagan. Iltimos, WooCommerce-ni yangilashdan oldin ularni yangilang yoki muvofiqligini tasdiqlang yoki sizda muammolar paydo bo\'lishi mumkin:','Add shipping'=>'Yuk tashishni qo\'shing','Order details manually sent to customer.'=>'Buyurtma tafsilotlari mijozga qo\'lda yuboriladi.','Choose an action...'=>'Harakatni tanlang ...','Position'=>'Holat','Upload a new file'=>'Yangi faylni yuklang','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Fayl bo\'sh yoki UTF-8-ga qaraganda boshqa kodlash usulidan foydalangan holda, yangi fayl bilan qayta urinib ko\'ring.','Lifetime Subscription'=>'Hayotiy obuna','Sort by:'=>'Tartiblash:','The stock has not been updated because the value has changed since editing. Produc