rishingiz mumkin va agar siz boshqa muammolarga duch kelsangiz, iltimos, qo\'llab-quvvatlash xizmatiga murojaat qiling.','Sorry! We tried, but we couldn\'t install Jetpack for you 😭. Please go to the Plugins tab to install it, and finish setting up your store.'=>'Kechirasiz! Biz sinab ko\'rdik, ammo Jetpack-ni o\'rnatib bo\'lmadi 😭. O\'rnatish uchun Plaginlar yorlig\'iga o\'ting va do\'koningizni sozlashni tugating.','Sorry! We tried, but we couldn\'t connect Jetpack just now 😭. Please go to the Plugins tab to connect Jetpack, so that you can finish setting up your store.'=>'Kechirasiz! Biz sinab ko\'rdik, lekin hozir Jetpack-ni ulab bo\'lmadi. Iltimos, Jetpack-ni ulash uchun Plaginlar yorlig\'iga o\'ting, shunda do\'koningizni sozlashni tugatishingiz mumkin.','Share new items on social media the moment they\'re live in your store.'=>'Yangi narsalarni do\'konda yashab turgan paytingizda ijtimoiy tarmoqlarda ulashing.','Product promotion'=>'Mahsulotni reklama qilish','Get an alert if your store is down for even a few minutes.'=>'Do\'koningiz bir necha daqiqaga ishlamay qolsa, ogohlantirish oling.','Store monitoring'=>'Do\'kon monitoringi','Get insights on how your store is doing, including total sales, top products, and more.'=>'Do\'koningiz qanday ishlashi, jumladan, umumiy savdo, eng yaxshi mahsulotlar va boshqa narsalar haqida ma\'lumot oling.','Store stats'=>'Do\'konning statistikasi','Protect your store from unauthorized access.'=>'Do\'koningizni ruxsatsiz kirishdan saqlang.','Better security'=>'Xavfsizlik yaxshiroq','Bonus reasons you\'ll love Jetpack'=>'Sizga Jetpack-ni yoqtiradigan bonus sabablari','By connecting your site you agree to our fascinating <a href="%1$s" target="_blank">Terms of Service</a> and to <a href="%2$s" target="_blank">share details</a> with WordPress.com'=>'Saytingizni ulab, siz bizning ajoyib <a href="%1$s" target="_blank">Xizmat ko\'rsatish shartlarimizga</a> rozilik bildirasiz va WordPress.com bilan <a href="%2$s" target="_blank">ma\'